import {
  BrowserRouter,
  Navigate,
  Route,
  Routes,
  useNavigate,
} from "react-router-dom";
import HomePage from "./homePage/HomePage";
import Login from "./login/Login";

function App() {
  const token: any = localStorage.getItem("access_token");
  const navigate = useNavigate();
  const checkToken = () => {
    return token ? navigate("/HomePage") : navigate("/HomePage");
  };
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/HomePage" element={checkToken()} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
